import "./ToolFooter.scss";

function ToolFooter() {
    return (
        <div className="toolFooterWrapper">
            <div className="footerContentWrapper"></div>
            <div className="toolWrapper">
                <div className="toolItem"></div>
                <div className="toolItem"></div>
                <div className="toolItem"></div>
                <div className="toolItem"></div>
            </div>
        </div>
    );
}

export default ToolFooter;
